import React from "react";
import Button from "react-bootstrap/Button";
import { useNavigate } from "react-router";
import { Card } from "react-bootstrap";
import { motion } from "framer-motion";
import { TextField } from "@mui/material";

const SignUp = () => {
  const navigate = useNavigate();

  const GoToSignIn = () => {
    navigate("/");
  };

  const GoToConfirmMail = () => {
    navigate("/mailconfirm");
  };

  return (
    <div className="background_signin">
      <motion.div
        initial={{ y: "5vh" }}
        animate={{ y: 0 }}
        transition={{ duration: 1, type: "spring", stiffness: 100 }}
      >
        <Card
          border="success"
          style={{ width: "18rem" }}
          className="card_signin"
        >
          <Card.Header className="cityty_style">Cityty</Card.Header>
          <Card.Body>
            <TextField
              id="email"
              size="normal"
              label="Email"
              variant="filled"
              fullWidth
              margin="none"
            />
            <TextField
              id="password"
              label="Password"
              size="normal"
              type="password"
              autoComplete="current-password"
              variant="filled"
              fullWidth
              margin="none"
            />
            <TextField
              id="password2"
              label="Confirm password"
              size="normal"
              type="password"
              autoComplete="current-password"
              variant="filled"
              fullWidth
              margin="none"
            />
            <div className="container-button_form">
              <Button
                variant="link"
                className="button_form"
                onClick={() => GoToConfirmMail()}
              >
                Submit
              </Button>
              <Button
                variant="link"
                className="button_form"
                onClick={() => GoToSignIn()}
              >
                Back
              </Button>
            </div>
          </Card.Body>
        </Card>
      </motion.div>
    </div>
  );
};

export default SignUp;
